import React from "react"
import './Travel.css'

export default class Travel extends React.Component {
  render() {
    return (
      <div className="travel-container">
          <div className="travel-emoji">
            {this.props.emoji}
            {this.props.type}
          </div>
      </div>
    )
  }
}
